import React, { useState, useEffect, useCallback } from 'react';
import {
  Typography,
  Container,
  Paper,
  Box,
  Button,
  CircularProgress,
  Alert,
  TextField,
  Grid,
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  DialogTitle,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
  Chip,
  OutlinedInput,
  Tooltip,
  IconButton,
  FormControlLabel,
  Checkbox,
  FormGroup
} from '@mui/material';
import InfoIcon from '@mui/icons-material/Info';
import { getMyProfile, updateMyProfile, deleteMyAccount } from '../api';
import { useNavigate } from 'react-router-dom';

// Constants based on backend models
const SEX_OPTIONS = ['male', 'female', 'other'];
const FITNESS_LEVELS = ['beginner', 'intermediate', 'advanced'];
const GOAL_TYPES = [
  'weight loss',
  'muscle gain',
  'endurance',
  'strength',
  'general fitness',
  'sport specific'
];

// Helper function to extract fields based on backend model
const getInitialFormData = (profile) => ({
  name: profile?.name || '',
  email: profile?.email || '',
  age: profile?.age || 18,
  sex: profile?.sex || '',
  weight: profile?.weight || 0,
  height: profile?.height || 0,
  current_fitness: {
    fitness_level: profile?.current_fitness?.fitness_level || '',
    training_frequency: profile?.current_fitness?.training_frequency || 3,
    body_fat_percentage: profile?.current_fitness?.body_fat_percentage || 0,
    personal_records: {
      deadlift: profile?.current_fitness?.personal_records?.deadlift || 0,
      squat: profile?.current_fitness?.personal_records?.squat || 0,
      bench: profile?.current_fitness?.personal_records?.bench || 0,
    }
  },
  goals: {
    goal_types: profile?.goals?.goal_types || [],
    target_weight: profile?.goals?.target_weight || 0,
    target_body_fat: profile?.goals?.target_body_fat || 0,
    target_personal_records: {
      deadlift: profile?.goals?.target_personal_records?.deadlift || 0,
      squat: profile?.goals?.target_personal_records?.squat || 0,
      bench: profile?.goals?.target_personal_records?.bench || 0,
    }
  },
});

const InfoTooltip = ({ title, children }) => (
  <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
    {children}
    <Tooltip title={title} arrow>
      <IconButton size="small" sx={{ padding: 0.5 }}>
        <InfoIcon fontSize="small" color="action" />
      </IconButton>
    </Tooltip>
  </Box>
);

const ProfilePage = () => {
  const [profile, setProfile] = useState(null);
  const [formData, setFormData] = useState(getInitialFormData(null));
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [isEditing, setIsEditing] = useState(false);
  const [deleteConfirmOpen, setDeleteConfirmOpen] = useState(false);
  const navigate = useNavigate();

  const fetchProfile = useCallback(async () => {
    setLoading(true);
    setError('');
    setSuccess('');
    try {
      const { data } = await getMyProfile();
      setProfile(data);
      setFormData(getInitialFormData(data));
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to fetch profile. Please try again.');
      if (err.response?.status === 401) {
        localStorage.removeItem('genfitAuth');
        navigate('/login', { state: { from: { pathname: '/profile' } } });
      }
    }
    setLoading(false);
  }, [navigate]);

  useEffect(() => {
    fetchProfile();
  }, [fetchProfile]);

  const handleChange = (e) => {
    const { name, value, type } = e.target;
    const parsedValue = type === 'number' ? parseFloat(value) || 0 : value;

    if (name.includes('.')) {
      const parts = name.split('.');
      if (parts.length === 2) {
        const [parent, child] = parts;
        setFormData(prev => ({ 
          ...prev, 
          [parent]: { ...prev[parent], [child]: parsedValue }
        }));
      } else if (parts.length === 3) {
        const [parent, middle, child] = parts;
        setFormData(prev => ({ 
          ...prev, 
          [parent]: { 
            ...prev[parent], 
            [middle]: { ...prev[parent][middle], [child]: parsedValue }
          }
        }));
      }
    } else {
      setFormData(prev => ({ ...prev, [name]: parsedValue }));
    }
  };

  const handleGoalTypesChange = (e) => {
    const value = e.target.value;
    setFormData(prev => ({
      ...prev,
      goals: {
        ...prev.goals,
        goal_types: typeof value === 'string' ? value.split(',') : value
      }
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setSuccess('');

    // Validation
    if (formData.age < 13) {
      setError('Age must be at least 13 years old.');
      setLoading(false);
      return;
    }

    if (formData.current_fitness.training_frequency < 1 || formData.current_fitness.training_frequency > 7) {
      setError('Training frequency must be between 1 and 7 days per week.');
      setLoading(false);
      return;
    }

    try {
      const { data } = await updateMyProfile(formData);
      setProfile(data);
      setFormData(getInitialFormData(data));
      setIsEditing(false);
      setSuccess('Profile updated successfully!');
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to update profile. Please ensure all fields are valid.');
    }
    setLoading(false);
  };

  const handleDeleteAccount = async () => {
    setDeleteConfirmOpen(false);
    setLoading(true);
    setError('');
    try {
      await deleteMyAccount();
      localStorage.removeItem('genfitAuth');
      navigate('/login', { state: { message: 'Account deleted successfully.' } });
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to delete account.');
      setLoading(false);
    }
  };

  if (loading && !profile) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="calc(100vh - 200px)">
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Container maxWidth="md">
      <Paper sx={{ p: { xs: 2, md: 4 }, mt: 3 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          User Profile
        </Typography>

        {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}
        {success && <Alert severity="success" sx={{ mb: 2 }}>{success}</Alert>}

        {profile && !isEditing && (
          <Box>
            <Typography variant="h6">Name: {profile.name}</Typography>
            <Typography>Email: {profile.email}</Typography>
            <Typography>Age: {profile.age}</Typography>
            <Typography>Sex: {profile.sex}</Typography>
            <Typography>Weight: {profile.weight} kg</Typography>
            <Typography>Height: {profile.height} cm</Typography>

            <Typography variant="h6" sx={{ mt: 2 }}>Current Fitness</Typography>
            <Typography>Fitness Level: {profile.current_fitness?.fitness_level}</Typography>
            <Typography>Training Frequency: {profile.current_fitness?.training_frequency} days/week</Typography>
            {profile.current_fitness?.body_fat_percentage > 0 && (
              <Typography>Body Fat: {profile.current_fitness.body_fat_percentage}%</Typography>
            )}

            {(profile.current_fitness?.personal_records?.deadlift > 0 || 
              profile.current_fitness?.personal_records?.squat > 0 || 
              profile.current_fitness?.personal_records?.bench > 0) && (
              <>
                <Typography variant="subtitle2" sx={{ mt: 1 }}>Personal Records:</Typography>
                {profile.current_fitness.personal_records.deadlift > 0 && (
                  <Typography>Deadlift: {profile.current_fitness.personal_records.deadlift} kg</Typography>
                )}
                {profile.current_fitness.personal_records.squat > 0 && (
                  <Typography>Squat: {profile.current_fitness.personal_records.squat} kg</Typography>
                )}
                {profile.current_fitness.personal_records.bench > 0 && (
                  <Typography>Bench Press: {profile.current_fitness.personal_records.bench} kg</Typography>
                )}
              </>
            )}

            <Typography variant="h6" sx={{ mt: 2 }}>Goals</Typography>
            <Typography>Goal Types: {profile.goals?.goal_types?.join(', ')}</Typography>
            {profile.goals?.target_weight > 0 && (
              <Typography>Target Weight: {profile.goals.target_weight} kg</Typography>
            )}
            {profile.goals?.target_body_fat > 0 && (
              <Typography>Target Body Fat: {profile.goals.target_body_fat}%</Typography>
            )}

            <Box sx={{ mt: 3, display: 'flex', gap: 2 }}>
              <Button variant="contained" onClick={() => setIsEditing(true)} disabled={loading}>
                Edit Profile
              </Button>
              <Button variant="outlined" color="error" onClick={() => setDeleteConfirmOpen(true)} disabled={loading}>
                Delete Account
              </Button>
            </Box>
          </Box>
        )}

        {isEditing && (
          <form onSubmit={handleSubmit}>
            <Grid container spacing={3}>
              {/* Basic Information */}
              <Grid item xs={12}>
                <Typography variant="h6" color="primary">Basic Information</Typography>
              </Grid>

              <Grid item xs={12} sm={6}>
                <TextField 
                  label="Name" 
                  name="name" 
                  value={formData.name} 
                  onChange={handleChange} 
                  fullWidth 
                  required 
                />
              </Grid>

              <Grid item xs={12} sm={6}>
                <InfoTooltip title="Must be a valid email address">
                  <TextField 
                    label="Email" 
                    name="email" 
                    type="email" 
                    value={formData.email} 
                    onChange={handleChange} 
                    fullWidth 
                    required 
                  />
                </InfoTooltip>
              </Grid>

              <Grid item xs={12} sm={6}>
                <InfoTooltip title="Must be at least 13 years old">
                  <TextField 
                    label="Age" 
                    name="age" 
                    type="number" 
                    value={formData.age} 
                    onChange={handleChange} 
                    fullWidth 
                    required 
                    InputProps={{ inputProps: { min: 13 } }}
                  />
                </InfoTooltip>
              </Grid>

              <Grid item xs={12} sm={6}>
                <FormControl fullWidth required>
                  <InputLabel>Sex</InputLabel>
                  <Select
                    name="sex"
                    value={formData.sex}
                    onChange={handleChange}
                    label="Sex"
                  >
                    {SEX_OPTIONS.map((option) => (
                      <MenuItem key={option} value={option}>
                        {option.charAt(0).toUpperCase() + option.slice(1)}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </Grid>

              <Grid item xs={12} sm={6}>
                <InfoTooltip title="Weight in kilograms (kg)">
                  <TextField 
                    label="Weight (kg)" 
                    name="weight" 
                    type="number" 
                    value={formData.weight} 
                    onChange={handleChange} 
                    fullWidth 
                    required
                    InputProps={{ inputProps: { step: 0.1, min: 0 } }}
                  />
                </InfoTooltip>
              </Grid>

              <Grid item xs={12} sm={6}>
                <InfoTooltip title="Height in centimeters (cm)">
                  <TextField 
                    label="Height (cm)" 
                    name="height" 
                    type="number" 
                    value={formData.height} 
                    onChange={handleChange} 
                    fullWidth 
                    required
                    InputProps={{ inputProps: { step: 0.1, min: 0 } }}
                  />
                </InfoTooltip>
              </Grid>

              {/* Current Fitness */}
              <Grid item xs={12}>
                <Typography variant="h6" color="primary" sx={{ mt: 2 }}>Current Fitness</Typography>
              </Grid>

              <Grid item xs={12} sm={6}>
                <FormControl fullWidth required>
                  <InputLabel>Fitness Level</InputLabel>
                  <Select
                    name="current_fitness.fitness_level"
                    value={formData.current_fitness.fitness_level}
                    onChange={handleChange}
                    label="Fitness Level"
                  >
                    {FITNESS_LEVELS.map((level) => (
                      <MenuItem key={level} value={level}>
                        {level.charAt(0).toUpperCase() + level.slice(1)}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </Grid>

              <Grid item xs={12} sm={6}>
                <InfoTooltip title="Number of training days per week (1-7)">
                  <TextField 
                    label="Training Frequency (days/week)" 
                    name="current_fitness.training_frequency" 
                    type="number" 
                    value={formData.current_fitness.training_frequency} 
                    onChange={handleChange} 
                    fullWidth 
                    required
                    InputProps={{ inputProps: { min: 1, max: 7 } }}
                  />
                </InfoTooltip>
              </Grid>

              <Grid item xs={12} sm={6}>
                <InfoTooltip title="Body fat percentage (optional)">
                  <TextField 
                    label="Body Fat Percentage (%)" 
                    name="current_fitness.body_fat_percentage" 
                    type="number" 
                    value={formData.current_fitness.body_fat_percentage} 
                    onChange={handleChange} 
                    fullWidth 
                    InputProps={{ inputProps: { step: 0.1, min: 0, max: 50 } }}
                  />
                </InfoTooltip>
              </Grid>

              {/* Personal Records */}
              <Grid item xs={12}>
                <Typography variant="subtitle1" sx={{ mt: 1 }}>Personal Records (Optional)</Typography>
              </Grid>

              <Grid item xs={12} sm={4}>
                <InfoTooltip title="Deadlift personal record in kilograms">
                  <TextField 
                    label="Deadlift (kg)" 
                    name="current_fitness.personal_records.deadlift" 
                    type="number" 
                    value={formData.current_fitness.personal_records.deadlift} 
                    onChange={handleChange} 
                    fullWidth 
                    InputProps={{ inputProps: { step: 0.5, min: 0 } }}
                  />
                </InfoTooltip>
              </Grid>

              <Grid item xs={12} sm={4}>
                <InfoTooltip title="Squat personal record in kilograms">
                  <TextField 
                    label="Squat (kg)" 
                    name="current_fitness.personal_records.squat" 
                    type="number" 
                    value={formData.current_fitness.personal_records.squat} 
                    onChange={handleChange} 
                    fullWidth 
                    InputProps={{ inputProps: { step: 0.5, min: 0 } }}
                  />
                </InfoTooltip>
              </Grid>

              <Grid item xs={12} sm={4}>
                <InfoTooltip title="Bench press personal record in kilograms">
                  <TextField 
                    label="Bench Press (kg)" 
                    name="current_fitness.personal_records.bench" 
                    type="number" 
                    value={formData.current_fitness.personal_records.bench} 
                    onChange={handleChange} 
                    fullWidth 
                    InputProps={{ inputProps: { step: 0.5, min: 0 } }}
                  />
                </InfoTooltip>
              </Grid>

              {/* Goals */}
              <Grid item xs={12}>
                <Typography variant="h6" color="primary" sx={{ mt: 2 }}>Goals</Typography>
              </Grid>

              <Grid item xs={12}>
                <InfoTooltip title="Select one or more fitness goals">
                  <FormControl fullWidth required>
                    <InputLabel>Goal Types</InputLabel>
                    <Select
                      multiple
                      name="goal_types"
                      value={formData.goals.goal_types}
                      onChange={handleGoalTypesChange}
                      input={<OutlinedInput label="Goal Types" />}
                      renderValue={(selected) => (
                        <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 0.5 }}>
                          {selected.map((value) => (
                            <Chip key={value} label={value} size="small" />
                          ))}
                        </Box>
                      )}
                    >
                      {GOAL_TYPES.map((goal) => (
                        <MenuItem key={goal} value={goal}>
                          {goal.charAt(0).toUpperCase() + goal.slice(1)}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                </InfoTooltip>
              </Grid>

              <Grid item xs={12} sm={6}>
                <InfoTooltip title="Target weight in kilograms (optional)">
                  <TextField 
                    label="Target Weight (kg)" 
                    name="goals.target_weight" 
                    type="number" 
                    value={formData.goals.target_weight} 
                    onChange={handleChange} 
                    fullWidth 
                    InputProps={{ inputProps: { step: 0.1, min: 0 } }}
                  />
                </InfoTooltip>
              </Grid>

              <Grid item xs={12} sm={6}>
                <InfoTooltip title="Target body fat percentage (optional)">
                  <TextField 
                    label="Target Body Fat (%)" 
                    name="goals.target_body_fat" 
                    type="number" 
                    value={formData.goals.target_body_fat} 
                    onChange={handleChange} 
                    fullWidth 
                    InputProps={{ inputProps: { step: 0.1, min: 0, max: 50 } }}
                  />
                </InfoTooltip>
              </Grid>

              {/* Target Personal Records */}
              <Grid item xs={12}>
                <Typography variant="subtitle1" sx={{ mt: 1 }}>Target Personal Records (Optional)</Typography>
              </Grid>

              <Grid item xs={12} sm={4}>
                <InfoTooltip title="Target deadlift in kilograms">
                  <TextField 
                    label="Target Deadlift (kg)" 
                    name="goals.target_personal_records.deadlift" 
                    type="number" 
                    value={formData.goals.target_personal_records.deadlift} 
                    onChange={handleChange} 
                    fullWidth 
                    InputProps={{ inputProps: { step: 0.5, min: 0 } }}
                  />
                </InfoTooltip>
              </Grid>

              <Grid item xs={12} sm={4}>
                <InfoTooltip title="Target squat in kilograms">
                  <TextField 
                    label="Target Squat (kg)" 
                    name="goals.target_personal_records.squat" 
                    type="number" 
                    value={formData.goals.target_personal_records.squat} 
                    onChange={handleChange} 
                    fullWidth 
                    InputProps={{ inputProps: { step: 0.5, min: 0 } }}
                  />
                </InfoTooltip>
              </Grid>

              <Grid item xs={12} sm={4}>
                <InfoTooltip title="Target bench press in kilograms">
                  <TextField 
                    label="Target Bench Press (kg)" 
                    name="goals.target_personal_records.bench" 
                    type="number" 
                    value={formData.goals.target_personal_records.bench} 
                    onChange={handleChange} 
                    fullWidth 
                    InputProps={{ inputProps: { step: 0.5, min: 0 } }}
                  />
                </InfoTooltip>
              </Grid>
            </Grid>

            <Box sx={{ mt: 4, display: 'flex', gap: 2 }}>
              <Button type="submit" variant="contained" color="primary" disabled={loading}>
                {loading ? <CircularProgress size={24} /> : 'Save Changes'}
              </Button>
              <Button 
                variant="outlined" 
                onClick={() => { 
                  setIsEditing(false); 
                  setError(''); 
                  setSuccess(''); 
                  setFormData(getInitialFormData(profile)); 
                }} 
                disabled={loading}
              >
                Cancel
              </Button>
            </Box>
          </form>
        )}

        {!profile && !loading && error && (
          <Alert severity="warning" sx={{ mb: 2 }}>Could not load profile data. {error}</Alert>
        )}
      </Paper>

      <Dialog
        open={deleteConfirmOpen}
        onClose={() => setDeleteConfirmOpen(false)}
      >
        <DialogTitle>Confirm Account Deletion</DialogTitle>
        <DialogContent>
          <DialogContentText>
            Are you sure you want to delete your account? This action cannot be undone.
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDeleteConfirmOpen(false)} color="primary" disabled={loading}>
            Cancel
          </Button>
          <Button onClick={handleDeleteAccount} color="error" disabled={loading} autoFocus>
            {loading ? <CircularProgress size={24} /> : 'Delete Account'}
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default ProfilePage;
